import React from "react";

import CountUp from "react-countup/build/CountUp";
import { useInView } from "framer-motion";
import { motion } from "framer-motion";
import { fadeIn } from "../variants";

const About = () => {
  const [ref, inView] = useInView({
    threshold: 0.5,
  });
  return (
    <section className="section" id="about">
      <div className="container mx-auto">
        <div className="flex-1 bg-about bg-contain bg-no-repeat h-[640px] mix-blend-lighten bg-top">
          img
        </div>

        <div>
          <h2>About me.</h2>
          <h3>I'm a Student at SMK TELKOM PURWOKERTO</h3>
          <p>
            Lorem ipsum, dolor sit amet consectetur adipisicing elit. Eos dolor
            porro suscipit similique quia expedita ratione dolorem dolores quam
            corporis?
          </p>

          <div className="flex gap-x-6 lg:gap-x-10 mb-12">
            <div>
              <div className="text-[40px] font-tertiary text-gradient mb-2">
                {inView ? <CountUp start={0} end={13} duration={3} /> : null}
              </div>
              <div className="font-primary text-sm tracking-[2px]">
                Years of <br />
                Experience
              </div>
            </div>
            <div>
              <div className="text-[40px] font-tertiary text-gradient mb-2">
                {inView ? <CountUp start={0} end={12} duration={3} /> : null}
              </div>
              <div className="font-primary text-sm tracking-[2px]">
                Projects <br />
                Completed
              </div>
            </div>
            <div>
              <div className="text-[40px] font-tertiary text-gradient mb-2">
                {inView ? <CountUp start={0} end={13} duration={3} /> : null}
              </div>
              <div className="font-primary text-sm tracking-[2px]">
                Satisfied <br />
                Clients
              </div>
            </div>
          </div>
          
          <div></div>
        </div>
      </div>
    </section>
  );
};

export default About;
